import _ from 'lodash';
import React, { Component } from 'react';
import cardFields from './cardFields';
import Card from './Card';
import img1 from '../../images/photo3.jpeg';

const cardStyle = {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-between'
};

class Cards extends Component {
    renderFields() {
		return _.map(cardFields, ({ id, label, cImage, cText, forward, btnTxt }) => {
            const element = {
                k: id
            };
            console.log(element);
			return (
                <Card key={id} id={id} label={label} cImage={cImage} cText={cText} forward={forward} btnTxt={btnTxt}/>
            );
		});
    }

	render() {
		return (
                <div style={cardStyle} className="row">
                {this.renderFields()}
                </div>
		);
	}
}

export default Cards;
